import React, { Component } from 'react';
import { Navbar,Button,Nav,Form,FormControl } from 'react-bootstrap';

export default class App extends Component {
    render(){
        return (
          <>
          <Navbar className="navbar-b navbar-trans navbar-expand-md" expand="md" fixed="top" bg="dark" variant="dark">
            <Navbar.Brand href="#home">DevFolio</Navbar.Brand>
            <Nav className="navbar-collapse justify-content-end collapse">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#about">About</Nav.Link>
              <Nav.Link href="#certificate">Certificate</Nav.Link>
              <Nav.Link href="#work">Work</Nav.Link>
              <Nav.Link href="#contact">Contact</Nav.Link>
            </Nav>
            <Form inline>
              <FormControl type="text" placeholder="Search" className="mr-sm-2" />
              <Button variant="outline-info">Search</Button>
            </Form>
          </Navbar>       
        </>
        );
    }
}
